import React from 'react'

const Signup = () => {
  return (
    <div>
      <form action="" 
        style={{ 
          display:'flex', 
          flexDirection: 'column', 
          margin: 'auto', 
          width: '30%' 
        }}>
        <input 
          style={{ 
            margin: '5px', 
            height: '30px'
          }} 
          type="text" 
          name="username" 
          placeholder="Enter Username"
        />
        <input 
          style={{ 
            margin: '5px', 
            height: '30px'
          }} 
          type="email" 
          name="email" 
          placeholder="Enter Email"
        />
        <input style={{ margin: '5px', height: '30px'}} type="password" name="password" placeholder="Enter Password"/>
        <button style={{ margin: '5px', padding: '10px', background: 'teal', color:'white', border:'none', cursor: 'pointer'}}>Submit</button>
      </form>
    </div>
  )
}

export default Signup
